sys_variable_value.value:
(function execute(inputs, outputs) {

var cmd = './hcli token create'

if (inputs.name) { cmd = cmd +  ' --name ' + inputs.name }
if (inputs.type) { cmd = cmd +  ' --type ' + inputs.type }
if (inputs.symbol) { cmd = cmd +  ' --symbol ' + inputs.symbol }
if (inputs.initial_supply) { cmd = cmd +  ' --supply ' + inputs.initial_supply }
if (inputs.max_supply) { cmd = cmd + ' --maxsupply ' + inputs.max_supply }
if (inputs.decimals) { cmd = cmd +  ' --decimals ' + inputs.decimals }

if (inputs.treasury_account) { cmd = cmd +  ' --treasury ' + inputs.treasury_account }
if (inputs.supply_key) { cmd = cmd + ' --supplykey ' + inputs.supply_key }
if (inputs.admin_key) { cmd = cmd + ' --adminkey ' + inputs.admin_key }
if (inputs.freeze_key) { cmd = cmd + ' --freezekey ' + inputs.freeze_key }
if (inputs.pause_key) { cmd = cmd + ' --pausekey ' + inputs.pause_key }
if (inputs.wipe_key) { cmd = cmd + ' --wipekey ' + inputs.wipe_key }
if (inputs.kyc_key) { cmd = cmd + ' --kyckey ' + inputs.kyc_key.public_key }
if (inputs.memo) { cmd = cmd + ' --memo ' + inputs.memo }

for (i = 0; i < inputs.sign_with.length; i++) { cmd = cmd + ' --sign ' + inputs.sign_with[i] }

outputs.cmd = cmd

})(inputs, outputs);

