sys_variable_value.value:
(function execute(inputs, outputs) {

var cmd = './hcli token create'

if (inputs.name) { cmd = cmd +  ' --name ' + inputs.name }
if (inputs.type) { cmd = cmd +  ' --type ' + inputs.type }
if (inputs.symbol) { cmd = cmd +  ' --symbol ' + inputs.symbol }
if (inputs.initial_supply) { cmd = cmd +  ' --supply ' + inputs.initial_supply }
if (inputs.max_supply) { cmd = cmd + ' --maxsupply ' + inputs.max_supply }
if (inputs.decimals) { cmd = cmd +  ' --decimals ' + inputs.decimals }

if (inputs.treasury_account) {
//  treasury_account = new GlideRecord("x_snc_hspoke_account")
//  treasury_account.get(tx.treasury_account)
  cmd = cmd +  ' --treasury ' + inputs.treasury_account.account_id
  }

if (inputs.supply_key) {
//  supply_key = new GlideRecord("x_snc_hspoke_key")
//  supply_key.get(tx.supply_key)
  cmd = cmd + ' --supplykey ' + inputs.supply_key.public_key
  }

if (inputs.admin_key) {
//  admin_key = new GlideRecord("x_snc_hspoke_key")
//  admin_key.get(tx.admin_key)
  cmd = cmd + ' --adminkey ' + inputs.admin_key.public_key
  }

if (inputs.freeze_key) {
//  freeze_key = new GlideRecord("x_snc_hspoke_key")
//  freeze_key.get(tx.freeze_key)
  cmd = cmd + ' --freezekey ' + inputs.freeze_key.public_key
  }

if (inputs.pause_key) {
//  pause_key = new GlideRecord("x_snc_hspoke_key")
//  pause_key.get(tx.pause_key)
  cmd = cmd + ' --pausekey ' + inputs.pause_key.public_key
  }

if (inputs.wipe_key) {
//  wipe_key = new GlideRecord("x_snc_hspoke_key")
//  wipe_key.get(tx.wipe_key) 
  cmd = cmd + ' --wipekey ' + inputs.wipe_key.public_key
  }

if (inputs.kyc_key) {
  //kyc_key = new GlideRecord("x_snc_hspoke_key")
  //kyc_key.get(tx.kyc_key)
  cmd = cmd + ' --kyckey ' + inputs.kyc_key.public_key
  }

if (inputs.memo) {
  cmd = cmd + ' --memo ' + inputs.memo
  }

if (inputs.sign_with) {
  while (inputs.sign_with.next()) {
    cmd = cmd + ' --sign ' + inputs.sign_with.public_key
  }
}

outputs.cmd = cmd

})(inputs, outputs);

